import React from "react";
import {
  AppBar,
  Toolbar,
  IconButton,
  Typography,
  Button,
} from "@material-ui/core";
import { ShoppingCart } from "@material-ui/icons";
import AddToCart from "./AddToCart";

const cart = (items) => {
  return <AddToCart items={items}></AddToCart>;
};

const Header = (items) => {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6">My E-commerce Site</Typography>
        <IconButton edge="end" color="inherit">
          <ShoppingCart />
        </IconButton>
        <AddToCart items={items} />
      </Toolbar>
    </AppBar>
  );
};

export default Header;
